class Ieee8021CnControlChoice(TextualConvention, Integer32):
    reference = '32.3.1, 32.4.1, Table 32-2'
    description = "This controls what other object selects the CND defense mode and the Congestion Notification Priority Value (CNPV) alternate priority for a CNPV in an end station or Bridge component, or for a CNPV on a particular Port in an end station or Bridge component. It can take the following values: cpcAdmin(1) The CND defense mode and alternate priority are controlled by the administrative variables in the same table entry as this object. cpcAuto(2) This Port or all Ports' CND defense modes are controlled automatically, as indicated by ieee8021CnPortPriAutoDefenseMode, and the alternate priority by ieee8021CnComPriAutoAltPri. cpcComp(3) This CND defense mode and alternate priority are both controlled by ieee8021CnPortPriTable. "
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3))
    namedValues = NamedValues(("cpcAdmin", 1), ("cpcAuto", 2), ("cpcComp", 3))

class Ieee8021CnDefenseMode(TextualConvention, Integer32):
    reference = '32.1.1, 32.3.4, 32.4.2, 32.4.3, Table 32-2'
    description = 'For a given Congestion Notification Priority Value (CNPV), a port can operate in one of four CND defense modes. The CND defense mode determines whether congestion notification is enabled or not, and if enabled, whether the port translates the CNPV to a non-CNPV value on input, and whether the port removes CN TAGs on output. cptDisabled(1) The congestion notification capability is administratively disabled for this priority value and port. This priority is not a CNPV. The priority regeneration table controls the remapping of input frames on this port for this priority. CN TAGs are neither added by an end station nor stripped by a Bridge. cptInterior(2) On this port and for this CNPV, the priority parameters of input frames are not remapped, regardless of the priority regeneration table. CN TAGs are not added by an end station, and are removed from frames before being output by a Bridge. cptInteriorReady(3) On this port and for this CNPV, the priority parameters of input frames are not remapped, regardless of the priority regeneration table. CN TAGs can be added by an end station, and are not removed from frames by a Bridge. cptEdge(4) On this port and for this CNPV, the priority parameters of input frames are remapped to an alternate (non-CNPV) value, regardless of the priority regeneration table. CN TAGs are not added by an end station, and are removed from frames before being output by a Bridge. This mode is optional for an end station. '
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))
    namedValues = NamedValues(("cptDisabled", 1), ("cptInterior", 2), ("cptInteriorReady", 3), ("cptEdge", 4))

